import React from 'react'

const Persons = ( {persons, newFilter} ) => {
    console.log("impresion", newFilter)
    return (
        <div>
            {persons.map((element, index) => {
                if ( element.name.search(newFilter) !== -1) {
                    return ( 
                        <div key={index}><div>{element.name} {element.number}</div></div>
                    )    
                } else {
                    return null
                }
            })}
        </div>
    )
}

export { Persons }
